['Las palomitas de maíz son uno de los snacks favoritos de muchos. Sin duda, son un imprescindible en nuestras noches de cine, o de ver Netflix en casa . Pero también son el picoteo 💏💏💏💏perfecto para cualquier ocasión. Ya hemos visto cómo hacer palomitas en sartén, u otras versiones más dulces como las palomitas de Caramelo o las de chocolate. Pero hoy vamos con una opción más original🧑‍🍳, unas palomitas caramelizadas con Coca cola🌽. Unas divertidas palomitas con ese toque favorito de todos la bebida favorita de mucho la coca cola 🍾 para esto necesitamos 1/2 Taza Maíz para palomitas
▢Aceite de girasol (para hacer las palomitas)
▢2 Cdas Mantequilla (o un chorrito de aceite, para el caramelo)
▢2 Tazas Coca Cola
▢100 g Azúcar
Comezamos poniendo en la sartén un chorrito de aceite y lo ponemos al fuego. Cuando esté caliente, añadimos el maíz y tapamos la sartén🫕. Cuando ya las palomitas dejen de sonar las retiramos En otra sartén, ponemos la mantequilla, dejamos que se funda y añadimos el azúcar y la coca cola. Cocinamos a fuego lento hasta formar el caramelo. No dejaremos de mover hasta que la coca cola haya reducido y se forme un caramelo.Una vez tengamos listo el caramelo de coca cola, añadimos las palomitas y mezclamos bien hasta que todas estén bien cubiertas por el caramelo. Reservamos en una bandeja de horno, con un papel vegetal, de forma que no se peguen mucho unas a otras. Dejamos enfríar bien; y, ya tenemos listas unas riquísimas palomitas de caramelo y ahora sí a disfrutar de esta delicia
Amig@s participen y sigan la página para que disfrutemos de una tarde de película 📽️lo que más nos gusta 😂😂😂 @jennifer_tatiana25
